    alert("Data deleted")
}

   //function updateEvent
    updateEvent = () =>{
        this.setState({userid : 99999})
    }

    render(){
        return(

          <nav>
           <div>this is header</div>

           <NavLink to="just_url/id">Update</NavLink>

           <Switch>
             <Route path="/UserInsert" component={UserInsert}/>
             <Route path="/AboutContainer" component={AboutContainer}/>
